export const HHeader = () => {
  return (
    <>
      <div className="header-wrapper">
        <button className="server-header">
          <a href="/">サーバーの方はこちら</a>
        </button>
        <button className="client-server">
          <a href="/items">クライアントの方はこちら</a>
        </button>
      </div>
    </>
  );
};
